export const defaultState = {
  stars: [],
  view: {
    raFrom: 4.5,
    raTo: 6.5,
    decFrom: -15,
    decTo: 15,
    magLimit: 4.5,
    width: 600,
    height: 600
  },
  starStatus: DEFAULT_SERVICE_STATUS
};

export default function userReducer(state = defaultState, action) {
  switch (action.type) {
    case c.GET_STARS_SUCCESS:
    case c.GET_STARS_FAILURE:
      return {
        ...state,
        stars: action.stars,
        starStatus: action.starStatus,
      };

    default:
      return state;
  }
}
